Campaign.sol.content:
// SPDX-License-Identifier: UNLICENSED

pragma solidity >0.7.0 <0.9.0;

import "Donation.sol";

contract Campaign {

    Donation[] donations;

    function createToken(string memory name, uint amountNeeded, bool accept, uint minAMount) public returns(address) {
        Donation donation = new Donation(
            name, minAMount, accept, amountNeeded
        );
        donations.push(donation);
        return address(donation);
    }

    function getCampainName() public view {}
}

Donation.sol.content:
// SPDX-License-Identifier: UNLICENSED

pragma solidity >0.7.0 <0.9.0;

contract Donation {

    string public donationName;
    uint public donationMinAmount;
    uint public donationAmountNeeded;
    bool public acceptPaymentAfterAmountMet;

    address _owner;


    constructor(string memory name, uint minAmount, bool accept, uint amountNeeded) {
        donationName = name;
        donationMinAmount = minAmount;
        acceptPaymentAfterAmountMet = accept;
        donationAmountNeeded = amountNeeded;
        _owner = msg.sender;
    }


    function donate() payable external {
        require(msg.value >= donationMinAmount, "You cannot donate below ${_minAmount}");
        if (!acceptPaymentAfterAmountMet) {
            uint balance = address(this).balance;
            require(balance + msg.value <= donationAmountNeeded, "Your donation will cross the amount needed");
        }
    }

    function donationBalance() view external returns (uint) {
        return address(this).balance;
    }

    function withdraw() public {
        require(_owner == msg.sender, "Only owner of this donation can withdraw from it");
        payable(msg.sender).call{value: (address(this).balance)}("");
    }
}

